 protein loses nucleolar localization but remains blocked in the nucleoplasm]','Experimental verification','PMID: 23436734'),(8,'p21WAF1','Nucleus','Nucleus [GO:0005634]','Cytoplasm','Cytoplasm [GO:0005737]','CDN1A_HUMAN','P38936','>sp|P38936|CDN1A_HUMAN Cyclin-dependent kinase inhibitor 1 OS=Homo sapiens OX=9606 GN=CDKN1A PE=1 SV=3\nMSEPAGDVRQNPCGSKACRRLFGPVDSEQLSRDCDALMAGCIQEARERWNFDFVTETPLE\nGDFAWERVRGLGLPKLYLPTGPRRGRDELGGGRRPGTSPALLQGTAEEDHVDLSLSCTLV\nPRSGEQAEGSPGGPGDSQGRKRRQTSMTDFYHSKRRLIFSKRKP','','','','n.a.','Experimental verification','PMID: 16969692'),(9,'p27KIP','Nucleus','Nucleus [GO:0005634]','Cytoplasm','Cytoplasm [GO:0005737]','CDN1B_HUMAN','P46527','>sp|P46527|CDN1B_HUMAN Cyclin-dependent kinase inhibitor 1B OS=Homo sapiens OX=9606 GN=CDKN1B PE=1 SV=1\nMSNVRVSNGSPSLERMDARQAEHPKPSACRNLFGPVDHEELTRDLEKHCRDMEEASQRKW\nNFDFQNHKPLEGKYEWQEVEKGSLPEFYYRPPRPPKGACKVPAQESQDVSGSRPAAPLIG\nAPANSEDTHLVDPKTDPSDSQTGLAEQCAGIRKRPATDDSSTQNKRANRTEENVSDGSPN\nAGSVEQTPKKPGLRRRQT','autophagic cell death [GO:0048102]; cell cycle arrest [GO:0007050]; cellular response to lithium ion [GO:0071285]; DNA damage response, signal transduction by p53 class mediator resulting in cell cycle arrest [GO:0006977]; G1/S transition of mitotic cell cycle [GO:0000082]; heart development [GO:0007507]; mitotic cell cycle arrest [GO:0071850]; negative regulation of cardiac muscle tissue regeneration [GO:1905179]; negative regulation of cell cycle [GO:0045786]; negative regulation of cell growth [GO:0030308]; negative regulation of cell population proliferation [GO:0008285]; negative regulation of cyclin-dependent protein kinase activity [GO:1904030]; negative regulation of cyclin-dependent protein serine/threonine kinase activity [GO:0045736]; negative regulation of kinase activity [GO:0033673]; negative regulation of mitotic cell cycle [GO:0045930]; negative regulation of phosphorylation [GO:0042326]; negative regulation of transcription, DNA-templated [GO:0045892]; negative regulation of vascula